    "Simulated nests in wildlife management",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:06:49.506108",nt"name": "simulated-nests-in-wildlife-management",nt"isopen":
    false,nt"url": null,nt"notes": "Many of us have studied game bird nests.
    Usually we hoped to learn something about nesting cover, cover management and the
    birds and animals which seemed to eat the eggs in the nests as fast as we found
    them. This paper describes a technique for simulating nests which can answer some
    of the questions we ask with more precision and less effort than studies of natural
    nests. Also, it can provide some insight into the ways that egg eating birds and
    animals react or respond to cover character and other parts of their physical environment.
    The general procedure is not new, but biologists are applying the tool to new problems.
    There has been a need to establish some standard procedures and to review both possibilities
    and limitations. Thirty years ago, in a short article in the Journal of Wildlife
    Management, Charles Elton (1939} suggested that we really know very little about
    the way cover protects the prey. He also mentioned the desirability of analyzing
    "..the complex nature of cover more carefully than has hitherto been done". Writing
    further about the need for knowledge about cover efficiency in protecting prey,
    he said, "We require....to count the number of random contacts between predator
    and prey made in a given time... ". Essentially, the technique can do these things:
    (1) count random contacts and (2) provide an index to total predator activity. We
    know an egg eater encountered destroyed eggs...greater destruction rates mean eggeaters
    more thoroughly covered the plots sampled (Harvey Miller, communication 8/13/68)
